window.bookSummaryJSON = "<p><b>Contains books 1-3 of An Elven Pirate Lord, a fantasy harem series.</b></p> <p><b><i>Origins of a Pirate Lord</i></b><b>, book one</b></p> <p>Marooned in a strange land. Rescued by a sexy wood elf and her forest friends. Wes has a perilous journey in front of him to reclaim his home, his honor, and his future. In a world where political corruption is rife and there are dangers in every direction, the wood elf and her friends might not be what Wes was looking for, but they might be just what he needs.</p> <p><b><i>Rise of a Pirate Lord</i></b><b>, book two</b></p> <p>Conniving Pirate Lords, brutally powerful behemoths of the seas. Fierce maidens rocking the boat and the overwhelming forces of the Elven Navy. The adventure continues with<i> Rise of a Pirate Lord</i>.</p> <p><b><i>Vengeance of a Pirate Lord</i></b><b>, book three</b></p> <p>Wes' brazen rise through the Pirate Fleets ranks summons unwanted attention and with it, all sorts of problems. Monster infested continents, secrets hidden for centuries, and the entire Elven Navy stand in between the newest Pirate Lord and his goals, but he's not about to let them block his path. With allies old and new at his back, Wes will take the final steps on his journey as he takes his rightful place in the world.</p> <p>Join Wes in this epic conclusion to his adventure of acquiring a new home for his growing family.</p>"; 
